import React from "react";
import { Transition } from "semantic-ui-react";
const Place_Definer = ({ Card_Inform, visible, OnClosed, OnSumbit }) => {
  return (
    <Transition visible={visible} animation="fade up" duration={1200}>
      <div
        // style={{
        //   position: "absolute",
        //   bottom: "0%",
        //   width: "100%"
        // }}
      >
        {/* <div className="ui segment"> */}
          <form className="ui form">
            <label>Shop Name</label>
            <div className="two fields">
              <div className="field">
                <input type="text" name="Shop Name" />
              </div>
              <div class="default text">Select Country</div>
              <div className="field">
                <label>Country</label>
                <div class="ui fluid search selection dropdown">
                  <input type="hidden" name="country" />
                  <i class="dropdown icon"></i>
                  <div class="default text">Select Country</div>
                  <div class="menu">
                    <div class="item" data-value="af">
                      <i class="af flag"></i>Afghanistan
                    </div>
                    <div class="item" data-value="ax">
                      <i class="ax flag"></i>Aland Islands
                    </div>
                    <div class="item" data-value="al">
                      <i class="al flag"></i>Albania
                    </div>
                    <div class="item" data-value="dz">
                      <i class="dz flag"></i>Algeria
                    </div>
                    <div class="item" data-value="as">
                      <i class="as flag"></i>American Samoa
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </form>
        </div>
      {/* </div> */}
    </Transition>
  );
};

export default Place_Definer;
